import React from 'react'

class WorkExpFormat extends React.Component{

    render() {
        return(
        <div>
<table>
<thead>
    {
        this.props.columnNames.map(cname=>{
           return( 
            <td key={cname}>{cname}</td>
           )
        })
    } </thead>
<tbody>{
this.props?.tableData?.length? this.props.tableData.map(ele=>{
   return( <tr key={ele.sno}>
    <td>{ele.sno}</td>
    <td>{ele.CompanyName}</td>
    <td>{ele.position}</td>
    <td>{ele.yearrange}</td>
    </tr>)
}):""
}</tbody>
</table>
        </div>

    )}
}


export default WorkExpFormat
